import { GET_TVS, GET_TV } from "../../actions/types";

const initialState = {
  results: [],
  details: {}
};

export default function(state = initialState, action) {
  switch (action.type) {
    case GET_TVS:
      return {
        ...state,
        results: action.payload
      };

    case GET_TV:
      return {
        ...state,
        details: action.payload
      };

    default:
      return state;
  }
}
